- Key: ReleaseNotesUrl
  Value: https://www.mozilla.org/firefox/131.0beta/releasenotes/
- Locale: en-US
  Key: ReleaseNotes
  Value: |-
    New
    - When suggesting a default translation language, Firefox will now take into consideration languages you have previously used for translations.
    - Firefox will now temporarily remember when users grant permissions to sites (e.g. geolocation). Temporary permissions will be removed either after one hour or when the tab is closed.
    - Hovering the mouse over an unfocused tab will now display a visual preview of its contents.
    - You can now enable protection against suspected fingerprinters on Firefox for Android using custom and strict enhanced tracking protection options.

    - SameSite=None cookies will now be rejected when there is no Secure attribute included.
    - Bookmarks in Firefox for Android are now saved in the folder where you last added a bookmark, instead of defaulting to the top-level bookmarks folder.
    - Weve re-introduced the ability to navigate to the search engine home page by clicking on the search bar icons with a SHIFT key modifier.
    Developer
    - As part of the ongoing updates to SVG 2, SVGGraphicsElement.nearestViewportElement and SVGGraphicsElement.farthestViewportElement have been officially removed. Please note that these properties have had deprecation warnings since February.
    - Firefox now supports text fragments, which allows users to link directly to a specific portion of text in a web document via a special URL fragment. (Learn more)
    Web Platform
    - Support for Cookies Having Independent Partitioned State (CHIPS) was now added, allowing developers to opt a cookie into storage partitioned per top-level site. (Learn more)
